import * as types from './../constants/ActionType';

var initialState = [
    {
        id : 1,
        name : 'Hoc reactjs',
        status : true
    }
];
var myReducer = (state = initialState, action) => {
    switch(action.type) {
        case types.LIST_ALL :
            return state; 
        default:
            return state;
    }
}

export default myReducer;
